import { StyleSheet, Text, View } from 'react-native';
import React from 'react';

const BottomNav = (props) => {
  return (
    <View>
      <Text>BottomNav</Text>
    </View>
  );
};

export default BottomNav;

const styles = StyleSheet.create({});
